The Hotel Scandal



Stars: Jewell Marceau and Anastasia Pierce



It's rare that you'll admit to the things you do with yourself, when alone in a hotel room. But when Jewell takes her fun to the room's patio window for all to see, the hotel manager (Anastasia Pierce) has a few things to say about it. With a confiscated vibrator and security camera tapes as evidence, Jewell reluctantly agrees to an &quot;arrangement,&quot; rather than face the police. However, being gagged, straight jacketed and locked outside on the room's courtyard patio wasn't at all what she had in mind. And that's just the beginning.



